import Wrapper from '../../components/page-wrapper';
import { faRssSquare } from '@fortawesome/free-solid-svg-icons';
import {getAllProcessing} from '../../scripts/getAllProcessing';
let Proc = props => (<>
    <Wrapper title='Processing Experiments'>
 
        <p>Here are some projects I made when trying out Processing 
            using <a href="https://p5js.org/">p5.js</a>.
            <br />
            These may or may not be entirely functional.

            </p>

            {props.projData.ooga}

            <iframe frameBorder="0" style={{width:'100%', height:'1000px'}} src="/projects/processing/wavyboi/index.html"></iframe>

    </Wrapper></>
)

export default Proc

Proc.getInitialProps = async function(context) {
    const projData = {ooga:'booga'}
    return { projData }
  }
